import React from "react";
import Head from "next/head";
import Proptypes from "prop-types";


const NextApp = ({Component}) => {
    return (
         <>
            <Head>
                <meta charSet = "UTF-8" />
                <title>Next | App</title>
            </Head>

            <header>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                </ul>
            </header>

            <Component />



        </>
    );
}

NextApp.proptypes = {
    Component : Proptypes.elementType.isRequired,
};

export default NextApp;
